import React,{Component} from 'react';
import{Link} from 'react-router-dom';
import {Jumbotron,Container,Row,Col,Image,Button} from 'react-bootstrap';
import './Home.css';
export default class Home extends Component{
render(){
    return(
        <div>
        <img width="100%" src="assets/foto.png" class="img"/>  
        <div>
                <h2>Welcome To MSM</h2>
                <p>Cover is a one-page template for building simple and beautiful home pages.<br></br>
                   Download, edit the text, and add your own fullscreen background photo to make it your own.</p>
                <Link to="/profile">
                    <Button size="lg" variant="outline-secondary">Learn More</Button>
                </Link>
                </div>        
        </div>
    )
}
}
